import React from "react";
import { Grid, Paper, Avatar, TextField} from '@mui/material';
import LockIcon from '@mui/icons-material/Lock';
const Login = () => {
    const paperStyle = {padding:20, height:'70vh', width:'4sign00px', margin:'20px auto'};
    const avatarStyle = {backgroundColor:'green'};
    return(
        <Grid>
            <Paper elevation={10}  style={paperStyle}>
                <Grid align='center'>
                    <Avatar style={avatarStyle}> <LockIcon/> </Avatar>
                    <h2>Sign In</h2>
                    <TextField id="outlined-basic" label="Username" placeholder="Enter Username" variant="outlined" />
                    <TextField id="outlined-basic" label="Password" placeholder="Enter password" type="password" variant="outlined" />
                </Grid>
            </Paper>
        </Grid>
    )
}
export default Login;
